const string DP = $dp;

#property string carName
public void   setCarName(string s){ txt_name.text = &quot;УСН &quot; + s; }
public string getCarName()        { return txt_name.text; }

public void setFuel(int fuel){
  switch (fuel){
    case 1:
      txt_type.text(&quot;ДТ&quot;);
      txt_type.backCol(&quot;DT&quot;);
      break;
    case 2:
      txt_type.text(&quot;ДТ&quot;);
      txt_type.backCol(&quot;DT&quot;);
      break;
    case 3:
      txt_type.text(&quot;92&quot;);
      txt_type.backCol(&quot;AI92&quot;);
      break;
    case 4:
      txt_type.text(&quot;95&quot;);
      txt_type.backCol(&quot;AI95&quot;);
      break;
    default:
      txt_type.text(&quot;неизв&quot;);
      txt_type.backCol(&quot;red&quot;);
      break;
  }
}

dyn_dyn_anytype sortData(dyn_anytype vals){
  dyn_dyn_anytype result;
  for(int i=0; i&lt;4; i++){
    dyn_anytype t_post;
    for(int j=1; j&lt;=7; j++){
      dynAppend(t_post, vals[i*7+j]);
    }
    dynAppend(result, t_post);
  }
  return result;
}

string stsToText(int sts){
  string res;
  switch(sts){
    case 0x00:
      res = &quot;Ожидание&quot;;
      break;
    case 0x10:
      res = &quot;Разрешение&quot;;
      break;
    case 0x20:
      res = &quot;Налив&quot;;
      break;
    case 0x30:
      res = &quot;Пауза&quot;;
      break;
    case 0x40:
      res = &quot;Продолжение&quot;;
      break;
    case 0x60:
      res = &quot;Ошибка&quot;;
      break;
    case 0x80:
      res = &quot;Не активный&quot;;
      break;
    default:
      res = &quot;Неизвестно&quot;;
  }
  return res;
}

string stsToColor(int sts){
  string res;
  switch(sts){
    case 0x00:
      res = &quot;Yellow&quot;;
      break;
    case 0x10:
      res = &quot;Yellow&quot;;
      break;
    case 0x20:
      res = &quot;Green&quot;;
      break;
    case 0x30:
      res = &quot;Yellow&quot;;
      break;
    case 0x40:
      res = &quot;Green&quot;;
      break;
    case 0x60:
      res = &quot;Red&quot;;
      break;
    case 0x80:
      res = &quot;Red&quot;;
      break;
    default:
      res = &quot;Red&quot;;
  }
  return res;
}

void cbWorker(dyn_string dps, dyn_anytype vals){
  dyn_dyn_anytype dd_vals = sortData(vals);
  dyn_dyn_anytype dd_dps = sortData(dps);

  int dt_work = dd_vals[1][4] + dd_vals[2][4];
  int dt_grg  = dd_vals[1][5] + dd_vals[2][5];
  int ai_work = dd_vals[3][4] + dd_vals[4][4];
  int ai_grg  = dd_vals[3][5] + dd_vals[4][5];

  if(dt_work &gt; 0) {
    dt_end.backCol(&quot;Green&quot;);
    dt_end.text(&quot;ДТ Подключ.&quot;);
    dt_arm.visible(true);
    ai_arm.visible(false);
  }
  else if(ai_work &gt; 0) {
    dt_end.backCol(&quot;Red&quot;);
    dt_end.text(&quot;ДТ Отключ.&quot;);
    dt_arm.visible(false);
    ai_arm.visible(true);
  }
  else {
    dt_arm.visible(false);
    ai_arm.visible(false);
  }

  if(ai_work&gt;0){
    ai_end.backCol(&quot;Green&quot;);
    ai_end.text(&quot;АИ Подключ.&quot;);
  }else{
    ai_end.backCol(&quot;Red&quot;);
    ai_end.text(&quot;АИ Отключ.&quot;);
  }

  for(int i=1; i&lt;=dynlen(dd_vals); i++){
    if(dd_vals[i][1] == 1)
      setValue(&quot;pst&quot;+i+&quot;_ovr&quot;, &quot;backCol&quot;, &quot;Red&quot;);
    else
      setValue(&quot;pst&quot;+i+&quot;_ovr&quot;, &quot;backCol&quot;, &quot;Green&quot;);

    if(dd_vals[i][2] == 1)
      setMultiValue(&quot;pst&quot;+i+&quot;_vlv1&quot;, &quot;backCol&quot;, &quot;Green&quot;,
                    &quot;pst&quot;+i+&quot;_vlv2&quot;, &quot;backCol&quot;, &quot;Green&quot;);
    else
      setMultiValue(&quot;pst&quot;+i+&quot;_vlv1&quot;, &quot;backCol&quot;, &quot;Yellow&quot;,
                    &quot;pst&quot;+i+&quot;_vlv2&quot;, &quot;backCol&quot;, &quot;Yellow&quot;);


    setValue(&quot;pst&quot;+i+&quot;_state&quot;, &quot;text&quot;, stsToText(dd_vals[i][6]));
    sdShowValue(&quot;pst&quot;+i+&quot;_press&quot;, dd_dps[i][7], dd_vals[i][7], 1, &quot;1.234&quot;, 1, &quot;кг/см2&quot;);
  }

  bool vis_pst_sts_00 = ((vals[29]==1)&amp;(dd_vals[1][6]==0x00))|((vals[29]==2)&amp;(dd_vals[2][6]==0x00))|((vals[29]==3)&amp;(dd_vals[3][6]==0x00))|((vals[29]==4)&amp;(dd_vals[4][6]==0x00));
//   pst_sts_00.visible = vis_pst_sts_00;
  bool vis_pst_sts_10 = ((vals[29]==1)&amp;(dd_vals[1][6]==0x10))|((vals[29]==2)&amp;(dd_vals[2][6]==0x10))|((vals[29]==3)&amp;(dd_vals[3][6]==0x10))|((vals[29]==4)&amp;(dd_vals[4][6]==0x10));
//   pst_sts_10.visible= vis_pst_sts_10;
  bool vis_pst_sts_20 = ((vals[29]==1)&amp;(dd_vals[1][6]==0x20))|((vals[29]==2)&amp;(dd_vals[2][6]==0x20))|((vals[29]==3)&amp;(dd_vals[3][6]==0x20))|((vals[29]==4)&amp;(dd_vals[4][6]==0x20));
//   pst_sts_20.visible= vis_pst_sts_20;
  bool vis_pst_sts_30 = ((vals[29]==1)&amp;(dd_vals[1][6]==0x30))|((vals[29]==2)&amp;(dd_vals[2][6]==0x30))|((vals[29]==3)&amp;(dd_vals[3][6]==0x30))|((vals[29]==4)&amp;(dd_vals[4][6]==0x30));
//   pst_sts_30.visible= vis_pst_sts_30;
  bool vis_pst_sts_40 = ((vals[29]==1)&amp;(dd_vals[1][6]==0x40))|((vals[29]==2)&amp;(dd_vals[2][6]==0x40))|((vals[29]==3)&amp;(dd_vals[3][6]==0x40))|((vals[29]==4)&amp;(dd_vals[4][6]==0x40));
//   pst_sts_40.visible= vis_pst_sts_40;
  bool vis_pst_sts_60 = ((vals[29]==1)&amp;(dd_vals[1][6]==0x60))|((vals[29]==2)&amp;(dd_vals[2][6]==0x60))|((vals[29]==3)&amp;(dd_vals[3][6]==0x60))|((vals[29]==4)&amp;(dd_vals[4][6]==0x60));
//   pst_sts_60.visible= vis_pst_sts_60;
  bool vis_pst_sts_80 = ((vals[29]==1)&amp;(dd_vals[1][6]==0x80))|((vals[29]==2)&amp;(dd_vals[2][6]==0x80))|((vals[29]==3)&amp;(dd_vals[3][6]==0x80))|((vals[29]==4)&amp;(dd_vals[4][6]==0x80));
//   pst_sts_80.visible= vis_pst_sts_80;
  //СКРЫЛ КРУЖОЧКИ. УДАЛИТЬ КРУЖКИ И ПОЧИСТИТЬ КОД ЕСЛИ СОГЛАСУЮТ КВАДРАТИК
  pst_sts_def.visible(false);
  pst_sts_00.visible(false);
  pst_sts_10.visible(false);
  pst_sts_20.visible(false);
  pst_sts_30.visible(false);
  pst_sts_40.visible(false);
  pst_sts_60.visible(false);
  pst_sts_80.visible(false);
  //=======================================================================
  if(vis_pst_sts_60)
    usn_state.backCol(&quot;Red&quot;);
  else if(vis_pst_sts_20)
    usn_state.backCol(&quot;Green&quot;);
  else
    usn_state.backCol(&quot;Grey&quot;);

  if(dd_vals[1][3] == 2 || dd_vals[2][3] == 2 || dd_vals[3][3] == 2 || dd_vals[4][3] == 2){
    gnd_ok.visible(true);
    gnd_gr.visible(false);
    gnd_no.visible(false);
  }else if(dd_vals[1][3] == 1 || dd_vals[2][3] == 1 || dd_vals[3][3] == 1 || dd_vals[4][3] == 1){
    gnd_ok.visible(false);
    gnd_gr.visible(true);
    gnd_no.visible(false);
  }else{
    gnd_ok.visible(false);
    gnd_gr.visible(false);
    gnd_no.visible(true);
  }
}

